import React, { useState, useEffect } from "react";
import { Link, NavLink, useLocation } from "react-router-dom";
import cn from "classnames";
import logoImage from "../../../src/assets/img/logo/incript-logo.png";
import { handleClickScroll } from "../../lib/helpers";

const HeaderOne = () => {
  const [stickyClass, setStickyClass] = useState({
    fixed: "",
    header: "",
  });
  const [isMobileMenuVisible, setMobileMenuVisible] = useState(false);

  const stickNavbar = () => {
    if (window !== undefined) {
      let windowHeight = window.scrollY;
      windowHeight < 245
        ? setStickyClass({ fixed: "", header: "" })
        : setStickyClass({ fixed: "active-height", header: "sticky-menu" });
    }
  };

  useEffect(() => {
    window.addEventListener("scroll", stickNavbar);
    return () => window.removeEventListener("scroll", stickNavbar);
  }, []);

  const { hash, pathname } = useLocation();
  const isActiveLink = (id) => {
    return id === hash ? "active" : "";
  };

  const toggleMobileMenu = () => {
    setMobileMenuVisible(!isMobileMenuVisible);
  };

  return (
    <header id="header">
      <div id="header-fixed-height" className={cn(stickyClass.fixed)} />

      <div id="sticky-header" className={cn("menu-area", stickyClass.header)}>
        <div className={cn("container custom-container")}>
          <div className="row">
            <div className="col-12">
              <div className={"mobile-nav-toggler"} onClick={toggleMobileMenu}>
                <i className="fas fa-bars" />
              </div>

              <div className="menu-wrap">
                <nav className={"menu-nav"}>
                  <div className="logo">
                    <Link to={"/"}>
                      <img src={logoImage} alt="Incript Logo" />
                    </Link>
                  </div>

                  <div className={cn("navbar-wrap main-menu d-none d-lg-flex")}>
                    <ul className={"navigation"}>
                      <li
                        className={cn(
                          hash === "" && "active",
                          "menu-item-has-children"
                        )}
                      >
                        <Link
                          to="#header"
                          className={"section-link"}
                          onClick={() => handleClickScroll("header")}
                        >
                          Principal
                        </Link>
                      </li>
                      <li className={cn(hash === "#about" && "active")}>
                        <Link
                          to="#about"
                          className={"section-link"}
                          onClick={() => handleClickScroll("about")}
                        >
                          Sobre nós
                        </Link>
                      </li>
                      <li className={isActiveLink("#choose")}>
                        <Link
                          to="#choose"
                          className={"section-link"}
                          onClick={() => handleClickScroll("choose")}
                        >
                          Diferenciais
                        </Link>
                      </li>                      
                      <li className={isActiveLink("#roadmap")}>
                        <Link
                          to="#roadmap"
                          className={"section-link"}
                          onClick={() => handleClickScroll("roadmap")}
                        >
                          Precedentes
                        </Link>
                      </li>
                      <li className={isActiveLink("#faq")}>
                        <Link
                          to="#faq"
                          className={"section-link"}
                          onClick={() => handleClickScroll("faq")}
                        >
                          Perguntas Frequentes
                        </Link>
                      </li>                      
                      <li className={isActiveLink("#contact")}>
                        <Link
                          to="#contact"
                          className={"section-link"}
                          onClick={() => handleClickScroll("contact")}
                        >
                          Contato
                        </Link>
                      </li>
                    </ul>
                  </div>
                  <div className={cn("header-action", "d-none d-md-block")}>                    
                  </div>
                </nav>
              </div>

              {/* Mobile Menu */}
              {isMobileMenuVisible && (
                <div className={"mobile-menu"}>
                  <nav className={"menu-box"}>
                    <div className={"close-btn"} onClick={toggleMobileMenu}>
                      <i className="fas fa-times"></i>
                    </div>
                    <div className={"nav-logo"}>
                      <Link to="C:\incript-site\src\assets\img\logo\incript-logo.png">
                        <img src={logoImage} alt="Incript Logo" title="" />
                      </Link>
                    </div>

                    <div className={"menu-outer"}>
                      <ul className={"navigation"}>
                        <li
                          className={cn(
                            hash === "" && "active",
                            "menu-item-has-children"
                          )}
                        >
                          <Link
                            to="#header"
                            className={"section-link"}
                            onClick={() => {
                              handleClickScroll("header");
                              setMobileMenuVisible(false);
                            }}
                          >
                            Principal
                          </Link>
                        </li>
                        <li className={cn(hash === "#about" && "active")}>
                          <Link
                            to="#about"
                            className={"section-link"}
                            onClick={() => {
                              handleClickScroll("about");
                              setMobileMenuVisible(false);
                            }}
                          >
                            Sobre nós
                          </Link>
                        </li>                      
                        <li className={isActiveLink("#roadmap")}>
                          <Link
                            to="#roadmap"
                            className={"section-link"}
                            onClick={() => {
                              handleClickScroll("roadmap");
                              setMobileMenuVisible(false);
                            }}
                          >
                            Precedentes
                          </Link>
                        </li>                      
                        <li className={isActiveLink("#contact")}>
                          <Link
                            to="#contact"
                            className={"section-link"}
                            onClick={() => {
                              handleClickScroll("contact");
                              setMobileMenuVisible(false);
                            }}
                          >
                            Contato
                          </Link>
                        </li>
                      </ul>
                    </div>

                    <div className={"social-links"}>
                      <ul className="clearfix">
                        <li>
                          <a href="#">
                            <i className="fab fa-linkedin-in"></i>
                          </a>
                        </li>
                        <li>
                          <a href="#">
                            <i className="fab fa-instagram"></i>
                          </a>
                        </li>
                        <li>
                          <a href="#">
                            <i className="fab fa-facebook-f"></i>
                          </a>
                        </li>
                      </ul>
                    </div>
                  </nav>
                </div>
              )}
              {/* End Mobile Menu */}
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default HeaderOne;
